import SwipeableViews from "react-swipeable-views";

const IndexView = () => (
    <main>
        <SwipeableViews enableMouseEvents>
            <div>
                <h1>V60</h1>
            </div>
            <div>
                <h1>French Press</h1>
            </div>
        </SwipeableViews>
    </main>
);

export default IndexView;
